import React, { FC } from "react"

interface IProps {
    name: string
}

const ChildComponent : FC<IProps> = (props):JSX.Element =>{
    return(
        <div>
            name: {props.name}
            "hello world!"
        </div>
    )
}

export default ChildComponent;
